import { useEffect, useState } from 'react';

export default function PatientDashboard() {
  const [patients, setPatients] = useState([]);
  const [showForm, setShowForm] = useState(false);
  const [name, setName] = useState('');
  const [age, setAge] = useState('');
  const [disease, setDisease] = useState('');
  const [editingId, setEditingId] = useState(null);
  const token = localStorage.getItem('token');

  useEffect(() => {
    fetch('http://localhost:8080/api/patients', {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then((res) => res.json())
      .then((data) => setPatients(data));
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = { name, age: parseInt(age), disease };

    const url = editingId
      ? `http://localhost:8080/api/patients/${editingId}`
      : 'http://localhost:8080/api/patients';

    const method = editingId ? 'PUT' : 'POST';

    const res = await fetch(url, {
      method,
      headers: {
        'Content-Type': 'application/json',
        Authorization: `Bearer ${token}`,
      },
      body: JSON.stringify(data),
    });

    if (res.ok) {
      const result = await res.json();
      if (editingId) {
        setPatients(patients.map((p) => (p.id === result.id ? result : p)));
      } else {
        setPatients([...patients, result]);
      }
      resetForm();
    } else {
      alert("‚ùå Failed to save patient");
    }
  };

  const resetForm = () => {
    setName('');
    setAge('');
    setDisease('');
    setShowForm(false);
    setEditingId(null);
  };

  const handleEdit = (patient) => {
    setName(patient.name);
    setAge(String(patient.age));
    setDisease(patient.disease);
    setEditingId(patient.id);
    setShowForm(true);
  };

  return (
    <div className="p-6 min-h-screen bg-gradient-to-br from-blue-50 to-purple-100 rounded-xl">
      <h1 className="text-4xl font-bold text-purple-700 mb-6 text-center">
        üßæ Patient Dashboard
      </h1>

      <div className="flex justify-center">
        <button
          className={`mb-6 px-5 py-2 rounded-xl text-white font-semibold transition-all ${
            showForm ? 'bg-red-500 hover:bg-red-600' : 'bg-green-500 hover:bg-green-600'
          }`}
          onClick={() => setShowForm(!showForm)}
        >
          {showForm ? 'Cancel' : '‚ûï Add Patient'}
        </button>
      </div>

      {showForm && (
        <form
          onSubmit={handleSubmit}
          className="bg-white shadow-md rounded-xl p-6 mb-6 w-full max-w-xl mx-auto space-y-4"
        >
          <input
            type="text"
            placeholder="Name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            className="w-full p-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-purple-300"
            required
          />
          <input
            type="number"
            placeholder="Age"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            className="w-full p-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-purple-300"
            required
          />
          <input
            type="text"
            placeholder="Disease"
            value={disease}
            onChange={(e) => setDisease(e.target.value)}
            className="w-full p-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-purple-300"
          />
          <button
            type="submit"
            className="w-full bg-purple-600 hover:bg-purple-700 text-white font-semibold py-2 rounded-lg"
          >
            {editingId ? 'Update Patient' : 'Submit Patient'}
          </button>
        </form>
      )}

      <div className="grid gap-4 md:grid-cols-2 lg:grid-cols-3">
        {patients.map((p) => (
          <div
            key={p.id}
            className="bg-white rounded-xl shadow-md p-4 flex flex-col justify-between border-l-4 border-purple-400"
          >
            <div>
              <h2 className="text-xl font-semibold text-gray-800">{p.name}</h2>
              <p className="text-sm text-gray-600">üß¨ Age: {p.age}</p>
              <p className="text-sm text-gray-600">üíâ Disease: {p.disease || 'N/A'}</p>
            </div>
            <button
              className="mt-4 bg-yellow-400 hover:bg-yellow-500 text-white px-3 py-1 rounded-lg"
              onClick={() => handleEdit(p)}
            >
              ‚úèÔ∏è Edit
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}
